	/**
	 * posts
	 * (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`)
	 */
	public static function posts() {
		return array(
			[ 1, 5, '2019-12-26 16:58:20', '2019-12-26 16:58:20', 'Walmart is testing out grocery deliveries shipped to consumers’ homes by self-driving car.\r\n\r\nThe nation’s largest retailer announced Tuesday a pilot program in Houston with autonomous vehicle maker Nuro to deliver groceries in vehicles that don’t require a human driver. Nuro, based in Mountain View, California, was founded by engineers who once worked at Google’s self-driving vehicle project in 2016.\r\n\r\nThe test is part of Walmart’s continued expansion in the grocery delivery business. The retailer says they now have grocery deliveries coming from 1,600 of their stores. Earlier this year, Walmart rolled out a $98 unlimited grocery delivery program.\r\n<blockquote>“We’ve been test-driving a number of different options for getting groceries from our stores to our customers’ front doors through self-driving technology,” said Tom Ward, senior vice president of digital operations for Walmart U.S., in a statement.\r\n\r\n“By continuing to test autonomous vehicle capabilities, we’re better able to understand the path self-driving technology can take us down the road,” said Tom Ward, Walmart’s SVP of digital operations, in a statement.</blockquote>\r\nThe Nuro is a delivery van resembling a moving toaster and requires consumers to retrieve their groceries directly from the vehicle.\r\n\r\nNuro has been mapping parts of Houston for its autonomous vehicles for months now, according to the Washington Post, as it has been testing its grocery delivery program. That work was being done with Toyota Priuses, which will continue, but this week’s announcement is about a new phase that will introduce the company’s custom-built vehicle, known as the R2, to the mix. The R2 driverless van can hold around 12 bags of groceries and is designed to travel on public roads, not sidewalks or bike lanes.\r\n\r\nThe R2 has two separate bins that are unlocked by customers using a touchscreen keypad and a code to access their order. The van was designed to look friendly and not put the grocery bags at too high or low a level for customers to take them out when it pulls up to your home.\r\n\r\nWalmart is among several businesses fighting for dominance in the rising grocery delivery business. Amazon boasts its own competing service, while Target partners with service Shipt to offer grocery delivery. There’s also Instacart, which works with various stores to deliver goods.\r\n\r\nFor now, to participate in the Houston autonomous vehicle (AV) deliveries, customers have to opt in, and even then Nuro is only delivering from a few “select” area Walmart stores. Nuro says it will expand its robot delivery service to the general public later in 2020.\r\n\r\nNuro tested AV grocery deliveries at Fry’s stores in Scottsdale, Arizona for nine months starting in 2018 and charged customers $5.95 per delivery. The New York Times says that “thousands” of customers took advantage of the R1’s delivery service. Nuro also announced earlier this year that it will start delivering pizzas with Domino’s in Houston soon.', 'Walmart Delivers Via Self-Driving Car', '', 'publish', 'closed', 'closed', '', 'walmart-delivers-via-self-driving-car', '', '', '2020-06-28 22:21:38', '2020-06-28 22:21:38', '', 0, '{{SANDBOX_URL}}?p=1', 0, 'post', '', 1 ],
			[ 2, 5, '2020-06-26 16:58:20', '2020-06-26 16:58:20', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"{{SANDBOX_URL}}wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2020-06-26 16:58:20', '2020-06-26 16:58:20', '', 0, '{{SANDBOX_URL}}?page_id=2', 0, 'page', '', 0 ],
			[ 4, 5, '2020-06-28 22:09:35', '2020-06-28 22:09:35', '', 'Candi Barr', '', 'publish', 'closed', 'closed', '', 'candi-barr', '', '', '2020-06-28 22:13:22', '2020-06-28 22:13:22', '', 0, '{{SANDBOX_URL}}?post_type=directory_profile&#038;p=4', 0, 'directory_profile', '', 0 ],
			[ 5, 5, '2020-06-28 22:15:56', '2020-06-28 22:15:56', '', 'Baby Ruth', '', 'publish', 'closed', 'closed', '', 'baby-ruth', '', '', '2020-06-28 22:15:56', '2020-06-28 22:15:56', '', 0, '{{SANDBOX_URL}}?post_type=directory_profile&#038;p=5', 0, 'directory_profile', '', 0 ],
			[ 7, 5, '2019-11-22 22:22:48', '2019-11-22 22:22:48', 'The <strong>USS Grayback</strong> was carrying 80 U.S. sailors when it sank in the waters south of Okinawa in February 1944. The ship is credited with sinking 14 enemy ships before it was torpedoed by the Japanese.\r\n\r\nPrivate explorers <strong>Tim Taylor </strong>and<strong> Christine Dennison</strong> found the Grayback in June and made the announcement Monday, on Veterans Day. The search ended when they spotted an anomaly on the ocean floor five months ago and high-definition cameras subsequently confirmed the vessel’s identity when they captured a gold plaque with the words USS Grayback.\r\n<blockquote>“It was amazing. Everyone was excited,” Taylor told The Washington Post. “Then you realize there are 80 men buried there, and it’s a sobering experience.”</blockquote>\r\nFollowing the discovery in June, Taylor and Dennison spent months searching for relatives of its crew who perished. The husband and wife duo said they are trying to find all 52 submarines that have sunk [during WWII] and were never found, as part of the <strong>Lost 52 Project</strong>. They said they’ve found five submarines so far.\r\n<blockquote>“We do not tell people that we’re looking for these because we don’t want to disappoint people, and we don’t want to blast it across the Internet until its done properly through the Navy,” Taylor told ABC News. “With the technology that we’re using, and the ability to cover large swaths of ground, we’re looking at the potential to find several more.”</blockquote>\r\nPart of the reason the submarine was lost for so many years, officials say, was because Japanese records on the sinking were not translated correctly. Researchers eventually found one digit was off, which had sent explorers 100 miles in the wrong direction.\r\n<blockquote>“The numbers that came out were wrong, and that’s how we found it,” Taylor said. “It was mistranslated after post-WWII, and they changed one number — an 8 to a 6 — and our Japanese translator re-translated it, found it, put us 100 miles to a different area.”</blockquote>\r\n<div id=\"attachment_61954\" class=\"wp-caption alignnone\">\r\n\r\n<img class=\"alignright size-medium wp-image-8\" src=\"{{SANDBOX_UPLOAD_URL}}2020/06/uss-grayback-sub-300x182.jpg\" alt=\"map showing location of where the grayback sub was located\" width=\"300\" height=\"182\" />\r\n<p id=\"caption-attachment-61954\" class=\"wp-caption-text\">Dennison said the most important part of their work is about bringing closure to the families of those who died.</p>\r\n\r\n</div>\r\n<blockquote>“It’s very vital that we remember them [the sailors], and that they feel that they haven’t been forgotten, that their sacrifice wasn’t in vain,” Dennison said. “We are grateful for their sacrifices, and we will never forget our veterans. The most important thing is, they’re here, now they can be celebrated again, they can be honored again, and we know where they are.”</blockquote>\r\n<p style=\"text-align: left;\">Taylor added, “The confirmation of the site as a US Navy sunken military craft ensures it is protected from disturbance, safeguarding the final resting place of our sailors.”</p>', 'USS Grayback torpedoed in 1944, found in 2019', 'Undersea explorers said they have found a long-lost U.S. submarine off the coast of Japan that sank during World War II.', 'publish', 'closed', 'closed', '', 'uss-grayback-torpedoed-in-1944-found-in-2019', '', '', '2020-06-28 22:48:38', '2020-06-28 22:48:38', '', 0, '{{SANDBOX_URL}}?p=7', 0, 'post', '', 0 ],
			[ 9, 5, '2019-10-19 22:26:59', '2019-10-19 22:26:59', 'Drs. William G. Kaelin Jr. of Harvard University, Gregg L. Semenza of Johns Hopkins University and Peter J. Ratcliffe of the Francis Crick Institute in Britain and Oxford University will share equally the $918,000 cash award, according to the Karolinska Institute, where the Nobel Committee is based.\r\n\r\n<img class=\"alignright size-medium wp-image-10\" src=\"{{SANDBOX_UPLOAD_URL}}2019/10/2019-Nobel-medicine-prize-820x461-1-300x169.jpg\" alt=\"Composited graphic of headshots the three Nobel Prize winners\" width=\"300\" height=\"169\" />Their work has “greatly expanded our knowledge of how physiological response makes life possible,” the committee said, explaining that the scientists identified the biological machinery that regulates how genes respond to varying levels of oxygen. That response is key to things like producing red blood cells, generating new blood vessels and fine-tuning the immune system.\r\n\r\nScientists are focused on developing drugs that can treat diseases either by activating or blocking the body’s oxygen-sensing machinery, the Nobel Committee said.\r\n\r\nThe oxygen response is hijacked by cancer cells, for example, which stimulate formation of blood vessels to help themselves grow. And people with kidney failure often get hormonal treatments for anemia, but the work of the laureates points the way toward new treatments, said committee member Nils-Goran Larsson, a researcher at the Karolinska Institute in Stockholm.\r\n\r\nExperts in the field praised the Nobel Committee’s choice.\r\n<blockquote>“Thanks to this research, we know much more about how different levels of oxygen impact on physiological processes in our bodies,” said <strong>Bridget Lumb</strong>, <strong>president of the Physiological Society in London</strong>. “This has huge implications for everything from recovery from injury and protection from disease, through to improving exercise performance.”</blockquote>\r\n[New York-born<strong> Kaelin</strong> began his own research laboratory at the Dana-Farber Cancer Institute in Boston and became a full professor at Harvard Medical School in 2002.] Kaelin said he was half-asleep Monday morning when the phone rang. It was Stockholm.\r\n<blockquote>“I was aware as a scientist that if you get a phone call at 5 a.m. with too many digits, it’s sometimes very good news, and my heart started racing,” the 61-year-old said. “It was all a bit surreal.”</blockquote>\r\n… [The American said scientists, particularly physician-scientists like himself and the other two laureates, were “under tremendous pressure” to justify the importance of their work.\r\n<blockquote>“I’d like to point out our story is one of trying to generate knowledge and to understand how things work, and if you go deep enough and you understand things well enough occasionally the opportunities for translation will arise,” he said.]</blockquote>\r\n<strong>Ratcliffe</strong>, 65, said he was summoned out of a meeting Monday morning by his secretary, who had “a look of urgency.” The man on the phone “had a Swedish accent, so I figured it probably wasn’t one of my friends pulling my leg,” he said.\r\n\r\nTrained as a kidney doctor, Ratcliffe said his research began in 1990 when he and colleagues simply wanted to figure out how cells sensed oxygen.\r\n<blockquote>“I thought it was a definable problem and just thought we’d find out how it worked,” he said. They were about two years into the research program when they realized the discovery had much wider significance.\r\n\r\n“We saw that it wasn’t just cells in the kidney that know how to sense oxygen, but all cells in the body,” he said. “They use this to do a huge range of other things, reprogram the cells, cause the growth of blood vessels, differentiation of cells. There are hundreds and thousands of processes the body uses to adapt to and regulate its oxygen levels.”</blockquote>\r\nHe said although some promising drugs had been developed, including for kidney patients who don’t get enough oxygen, it will be years before it’s clear how many lives will be changed by such discoveries.\r\n\r\nRatcliffe described his fellow laureates as “colleagues, competitors and friends.” He said he felt honored by the Nobel accolade but that his main goal had always been pure science.\r\n\r\n“The satisfaction is really finding things out that will continue to be true for all time,” he said. “This is for me an eternal truth, and as a scientist, we work away, we find these things out, and we hope they will be useful.”\r\n\r\nSemenza, 63, said he and colleagues were studying a gene in a rare cell type in the kidney and did an experiment that showed the factor they discovered was linked to oxygen. That’s when they realized it could have widespread physiological importance.\r\n\r\nIt turns out that the gene turns on erythropoietin, or EPO, when cells don’t get enough oxygen. EPO controls the production of red blood cells.\r\n<blockquote>“We found it very interesting that the body can respond to oxygen,” Semenza said. That discovery has led to treatments for people with chronic kidney disease who become anemic when their kidneys stop making EPO. “Now, drugs can turn on EPO production by increasing these factors.”</blockquote>\r\nIt’s likely one or more of these drugs will be approved for production in the next few years, and one has already been green-lighted in China, he said.\r\n\r\n<strong>Andrew Murray</strong>, a physiologist at the University of Cambridge, said the three laureates’ discovery was fundamental to understanding how to combat diseases of the heart and lungs as well as numerous cancers.\r\n<blockquote>“Low oxygen levels are a feature of some of the most life-threatening diseases,” he said. “When cells are short of oxygen, as is the case with heart failure and lung disease, the tissues need to respond to that in order to maintain energy levels.”</blockquote>\r\nMurray said the case of cancer was slightly different. Some cancer tumors thrive under low oxygen conditions, so scientists are trying to develop drugs to manipulate oxygen levels under these circumstances. “The work they have done is already leading the way to drugs that manipulate oxygen-sensing pathways,” he said.\r\n\r\nMonday’s announcement kicked off this year’s Nobel Prizes. The prize in physics will be handed out Tuesday, followed by the chemistry prize on Wednesday. This year’s doubleheader literature prizes — one each for 2018 and 2019 — will be awarded Thursday, and the peace prize will be announced Friday.\r\n\r\nThe 2018 Nobel Prize in literature was suspended after a sex abuse scandal rocked the Swedish Academy, the body that awards the literature prizes, so two prizes will be given out this year.\r\n\r\nThe economics prize will be awarded Oct. 14. Officially known as the Bank of Sweden Prize in Economic Sciences in Memory of Alfred Nobel, it wasn’t created by Nobel but by Riksbanken, Sweden’s central bank, in 1968.\r\n\r\nThe laureates will receive their awards at white-tie ceremonies in Stockholm and Oslo on Dec. 10 — the anniversary of Nobel’s death in 1896.', 'Three Win Nobel Prize for Learning How Cells Use Oxygen', 'Two Americans and a British scientist won the 2019 Nobel Prize in physiology or medicine for discovering how the body’s cells sense and react to oxygen levels, work that has paved the way for new strategies to fight anemia, cancer and other diseases, the Nobel Committee announced Monday.', 'publish', 'closed', 'closed', '', 'three-win-nobel-prize-for-learning-how-cells-use-oxygen', '', '', '2020-06-28 22:31:44', '2020-06-28 22:31:44', '', 0, '{{SANDBOX_URL}}?p=9', 0, 'post', '', 0 ],
