			[ 13, 5, '2020-06-28 22:34:12', '2020-06-28 22:34:12', 'This is a <span style=\"text-decoration: underline;\"><strong>testing</strong> </span>page. Last edited 24 Nov. 2020\r\n\r\nThis is the update to the testing page. It should trigger a revision. 30 Nov. 2020\r\n<p style=\"text-align: right;\">This is right-justified text way over here just in case someone needs it.</p>\r\n\r\n<ul>\r\n  <li>a bulleted list is here.</li>\r\n   <li>and here</li>\r\n   <li>and once more</li>\r\n</ul>\r\n<ol>\r\n   <li>This is numbered list item one</li>\r\n   <li>item two</li>\r\n   <li>item three</li>\r\n</ol>\r\n<blockquote>Quoted text looks like this</blockquote>\r\n&nbsp;', 'Furniture', '', 'publish', 'closed', 'closed', '', 'furniture', '', '', '2020-11-30 08:21:37', '2020-11-30 14:21:37', '', 0, '{{SANDBOX_URL}}?page_id=13', 16, 'page', '', 0 ],
