			[ 18, 5, '2020-01-29 22:40:24', '2020-01-29 22:40:24', '[caption id=\"attachment_19\" align=\"alignright\" width=\"300\"]<img class=\"size-medium wp-image-19\" src=\"{{SANDBOX_UPLOAD_URL}}2020/06/cellphone-pouch-820x547-1-300x200.jpeg\" alt=\"cell phones in numbered pouches on a classroom wall\" width=\"300\" height=\"200\" /> Cellphones sit in wall pockets during class at Tahquitz High School in Hemet, Calif.[/caption]\r\n\r\nBefore class each day, a <strong>high-school teacher in Indianapolis</strong> grabs a clear plastic bag and fastens it to her waist with a ribbon. The homemade pouch is a repository for phones that are either confiscated or handed over voluntarily by students who don’t want to be tempted to tap or swipe during class.\r\n\r\nShe calls it the “phoney pack,” and the magic of the makeshift vault isn’t that it keeps devices out of reach. It’s that it lowers students’ anxiety by keeping their phones in view.\r\n\r\nSmartphones have long been a scourge for teachers and administrators, who have employed a range of strict measures to keep them out of the classroom. But it turns out that getting rid of phones introduced another distraction: withdrawal pangs.\r\n\r\nNow, teachers across the country are testing their own methods for managing their students’ phone-related angst:\r\n<ul>\r\n  <li>Some use lockable pouches that let students hold their phones rather than having to leave them alone in their lockers.</li>\r\n   <li>Others have set up charging stations in classrooms, betting that the visibility and value of a charge will keep students at ease.</li>\r\n  <li>Then there are the teachers who have decided dangling extra credit and other prizes is the best defense against phone withdrawal.</li>\r\n</ul>\r\nStudents don’t always appreciate the efforts to appease them.\r\n\r\n[caption id=\"attachment_20\" align=\"alignleft\" width=\"214\"]<img class=\"size-medium wp-image-20\" src=\"{{SANDBOX_UPLOAD_URL}}2020/06/yondr-pouch-214x300.jpeg\" alt=\"A decorated Yondr pouch\" width=\"214\" height=\"300\" /> A decorated Yondr pouch at South Bronx Early College Academy Charter School.[/caption]\r\n\r\nDuring the first few weeks, students were “fiending” while waiting in line at the end of the day for the teacher to unlock their pouches, <strong>principal Brian Blough</strong> says. <strong>South Bronx Early College Academy Charter School in New York</strong> decided two years ago that making students leave their phones in their lockers wasn’t working: [Some] sneaked out of class to use them. So the school bought a bunch of locking, foamlike pouches from a company called <strong>Yondr</strong> that also markets its devices to theaters that want to prevent audience members from filming performances. The students can keep their phones with them but can’t access them without a special magnetic unlocking mechanism.\r\n\r\n<strong>Eighth-grader Olamide Oladitan</strong> and some of his fellow students tried to pry and cut open their pouches with objects like pens and scissors. “It didn’t work,” Mr. Oladitan said,…[admitting] he eventually gave in. “I didn’t like it because I really wanted to get to my phone,” he says, “but at the same time I didn’t hate it because it helped me get better grades.”\r\n\r\nSome schools have opted for the carrot over the stick. At <strong>High Point Academy Fort Worth in Texas</strong>, students in <strong>Jayne Lawrence’s</strong> English and creative writing classes download an app called Pocket Points that tracks when they touch their phones. Students can redeem points for different tiers of awards that kick in at 10, 15 and 24 class hours off the phone, earning prizes ranging from a drink at Starbucks to the ability to drop their worst test score.\r\n\r\nMs. Lawrence says the system is worth it because it gives her a way to combat students’ addiction without confrontation.\r\n\r\n“The quickest way here to burn a relationship is to take something from them,” she says.\r\n\r\nWhen <strong>Joseph Riffle’s school in Fairborn, Ohio</strong>, allowed teachers to set their own rules on devices, he realized his policy of letting kids keep phones on their desks as long as they didn’t use them was just too tempting. He also knew he couldn’t take the phones too far, considering they’re the most expensive thing some of the students own.\r\n\r\nSo the 32-year-old teacher purchased boxes with USB plugs on Amazon and set up a table near the front of his class where his sophomore American Studies students could charge their devices—and gaze at them from a distance. The expectation was “you turn in and you plug in,” he says.\r\n\r\nThe charging system worked for about three years until the school required phones to be put away all day.\r\n\r\nSome schools say confiscating devices at the start of each day is the only way to block all phone-related distractions and others threaten to put students’ phones in a locked “cell block,” hoping the fear of loss will lead to compliance.\r\n\r\nParents at <strong>Roosevelt High School in Seattle</strong> sent administrators dozens of thank-you notes and emails in 2018 when they announced the school would require cellphones to be put away in a bag or locker for the day. The school had previously allowed individual teachers to set their own rules. …\r\n\r\nWhen <strong>DREAM Charter High School in New York</strong> opened three years ago, teachers collected its roughly 100 students’ phones in homeroom each day, a task that became unwieldy as the school’s population grew to 300.\r\n\r\nDREAM now uses a “Harry Potter-like” system that allows students to earn points that give them privileges such as being able to hold on to their phone rather than having to lock them in a Yondr pouch, principal Jared Francis says. Students earn credit for good grades and actions such as persisting through challenges that help them achieve “prefect status,” a reference to the Hogwarts students who earn special privileges.\r\n\r\nMr. Francis says the school’s policy is aimed at teaching responsibility. “In the real world no one is confiscating my phone, but I use it a lot and I have to learn how to manage that,” he says.', 'Schools ban phones to improve student concentration', '', 'publish', 'closed', 'closed', '', 'schools-ban-phones-to-improve-student-concentration', '', '', '2020-06-28 22:47:50', '2020-06-28 22:47:50', '', 0, '{{SANDBOX_URL}}?p=18', 0, 'post', '', 0 ],
