			[ 41, 5, '2020-07-15 13:55:19', '2020-07-15 18:55:19', '<!-- wp:fl-builder/layout -->\n  <iframe src=\"https://www.google.com/maps/embed/v1/place?key=AIzaSyD09zQ9PNDNNy9TadMuzRV_UsPUoWKntt8&q=Donald+L.+Houston+Center%2C+Discovery+Drive%2C+College+Station%2C+TX\"></iframe>\n <p>&nbsp;</p>\n<p>Straight text from the text editor.</p>\n<h3>H3 Header</h3>\n<p>More text goes right in here.</p>\n<!-- /wp:fl-builder/layout -->', 'Location Map', '', 'publish', 'closed', 'closed', '', 'location-map', '', '', '2020-07-15 13:59:06', '2020-07-15 18:59:06', '', 0, '{{SANDBOX_URL}}?page_id=41', 17, 'page', '', 0 ],
			[ 56, 5, '2020-07-30 10:28:18', '2020-07-30 15:28:18', '<!-- wp:fl-builder/layout -->\r\n<p>[This page is an example of using the Beaver Builder to create an accordian page - where one line of information is created, and when clicked, it opens up to display the answer. It can be useful at times to display lists of information where people may be looking for something specific.]</p>\r\n<p><strong>The test form has been switched from on campus to an online platform (eCampus).</strong></p>\r\n<p><strong>Once the system is ready (approximately one week from 03/16/20) any student signed up to take the test – will be contacted with instructions.</strong></p>\r\n<p>Who should take the test?</p>\r\n<p>Students who intend to enroll for the first time in a college Spanish language course, who have any prior knowledge of the language, whether acquired at home or through formal studies, and who have no college credit in the language (AP or other) MUST take a placement test to determine the appropriate course for their level of ability. If your high school transcript shows that you have taken Spanish, you will be required to take the placement test.</p>\r\n<p>Why should I take the test?</p>\r\n<p>There are two benefits to taking the placement test. First, you will start your language studies at the most appropriate level for your abilities. Second, you will receive academic credit for levels of Spanish that you have already mastered, free of charge.</p>\r\n<p>How much does the test cost?</p>\r\n<p>There is a $30 fee that is due at the time of registration.</p>\r\n<!-- /wp:fl-builder/layout -->', 'Placement Test - Beaver Builder Accordian', '', 'publish', 'closed', 'closed', '', 'placement-test', '', '', '2020-07-30 10:28:56', '2020-07-30 15:28:56', '', 0, '{{SANDBOX_URL}}?page_id=56', 18, 'page', '', 0 ],
			[ 62, 5, '2020-08-17 12:55:49', '2020-08-17 17:55:49', '<!-- wp:fl-builder/layout -->\r\n<h2>DEPARTMENT OF PHILOSOPHY<br />COLLOQUIUM SERIES</h2>\r\n<h2><strong><br />THEODORE GEORGE</strong></h2>\r\n<p><img title=\"yondr-pouch\" src=\"{{SANDBOX_UPLOAD_URL}}2020/06/yondr-pouch.jpeg\" alt=\"A decorated Yondr pouch\" /></p>\r\n<h3><strong>BIOGRAPHY</strong></h3>\r\n<p>Dr. Theodore George is Associate Professor and Head of the Department of Philosophy at Texas A&amp;M University. His research and teaching focus on continental European philosophy since Kant. His areas of expertise include hermeneutics, ethical philosophy, Hegel and classical German philosophy, and the philosophy of art and aesthetics. He is the author of two books, The Responsibility to Understand: Hermeneutical Contours of Ethical Life (Edinburgh University Press, under contract and approved by EUP Press and Publishing Committees; manuscript submitted) ) and Tragedies of Spirit: Tracing Finitude in Hegel’s Phenomenology (State University of New York Press, 2006). His current projects include co-ed. with Gert-Jan van der Heiden, The Gadamerian Mind (Routledge) and co-ed. with Charles Bambach Philosophers and their Poets: Reflections on the Poetic Turn Since Kant (State University of New York Press, forthcoming December 2019). He is also translator of Günter Figal, Objectivity: The Hermeneutical and Philosophy (State University of New York Press, 2010) and author of numerous articles and book chapters.<br />George holds an appointment as Senior Researcher, College of Fellows, Western Sydney University, and he is Editor, Epoché: A Journal for the History of Philosophy, as well as category editor, PhilPapers, “Hermeneutics,” and leaf “Hans-Georg Gadamer.” His research has been supported by the Fulbright Commission, the Goethe Institute, the German Academic Exchange Service (DAAD), the Freiburg Institute for Advanced Studies at the University of Freiburg, Germany, as well as by the Rothrock Fellows Program and the Glasscock Center for Humanities Research at Texas A&amp;M University.</p>\r\n<h3><strong>HERMENEUTIC DISPLACEMENT</strong></h3>\r\n<p>Few topics have received broader attention within contemporary philosophy than that of responsibility. Current interest in such questions of responsibility draw on a broad range of approaches and methods, from those customarily associated with analytic philosophy to those associated with phenomenology and existentialism, deconstruction, critical theory, feminist theory, race theory, and post-colonial theory. Yet, despite the expanse of current interest, philosophers have not fully appreciated the contributions that can be made to questions of responsibility by contemporary hermeneutics. The purpose of my presentation will be to examine one contour of responsibility at issue in the hermeneutical experience of understanding. In this, I shall argue that the responsibility to understand is not foremost a responsibility to reach agreement or achieve correct knowledge of something. Rather, the responsibility to understand is a responsibility to cultivate and enact what I refer to as a capacity for displacement, that is, a capacity to put one’s prejudices—and thus oneself—into question, to remain open to the new in the face of such self-interrogation, and to come to understand things and oneself otherwise through it.</p>\r\n<h3><strong>Thursday, September 19, 2019 • 3:45 PM • YMCA 401</strong></h3>\r\n<p>&nbsp;</p>\r\n<!-- /wp:fl-builder/layout -->', 'Colloquium: Theodore George, Texas A&M University', '', 'publish', 'closed', 'closed', '', 'post-62', '', '', '2020-08-31 11:59:41', '2020-08-31 16:59:41', '', 0, '{{SANDBOX_URL}}?p=62', 0, 'post', '', 0 ],
