partment of Philosophy at Texas A&amp;M University. His research and teaching focus on continental European philosophy since Kant. His areas of expertise include hermeneutics, ethical philosophy, Hegel and classical German philosophy, and the philosophy of art and aesthetics. He is the author of two books, The Responsibility to Understand: Hermeneutical Contours of Ethical Life (Edinburgh University Press, under contract and approved by EUP Press and Publishing Committees; manuscript submitted) ) and Tragedies of Spirit: Tracing Finitude in Hegel’s Phenomenology (State University of New York Press, 2006). His current projects include co-ed. with Gert-Jan van der Heiden, The Gadamerian Mind (Routledge) and co-ed. with Charles Bambach Philosophers and their Poets: Reflections on the Poetic Turn Since Kant (State University of New York Press, forthcoming December 2019). He is also translator of Günter Figal, Objectivity: The Hermeneutical and Philosophy (State University of New York Press, 2010) and author of numerous articles and book chapters.\nGeorge holds an appointment as Senior Researcher, College of Fellows, Western Sydney University, and he is Editor, Epoché: A Journal for the History of Philosophy, as well as category editor, PhilPapers, “Hermeneutics,” and leaf “Hans-Georg Gadamer.” His research has been supported by the Fulbright Commission, the Goethe Institute, the German Academic Exchange Service (DAAD), the Freiburg Institute for Advanced Studies at the University of Freiburg, Germany, as well as by the Rothrock Fellows Program and the Glasscock Center for Humanities Research at Texas A&amp;M University.\";s:18:\"responsive_display\";s:0:\"\";s:18:\"visibility_display\";s:0:\"\";s:26:\"visibility_user_capability\";s:0:\"\";s:9:\"animation\";s:0:\"\";s:15:\"animation_delay\";s:3:\"0.0\";s:2:\"id\";s:0:\"\";s:5:\"class\";s:0:\"\";s:10:\"margin_top\";s:0:\"\";s:17:\"margin_top_medium\";s:0:\"\";s:21:\"margin_top_responsive\";s:0:\"\";s:12:\"margin_right\";s