\";s:13:\"5f3ac2d4e8ca5\";s:4:\"type\";s:6:\"module\";s:6:\"parent\";s:13:\"5f3ac2b6d84eb\";s:8:\"position\";i:0;s:8:\"settings\";O:8:\"stdClass\":25:{s:4:\"text\";s:78:\"<h3 style=\"text-align: center;\"><strong>HERMENEUTIC DISPLACEMENT</strong></h3>\";s:18:\"responsive_display\";s:0:\"\";s:18:\"visibility_display\";s:0:\"\";s:26:\"visibility_user_capability\";s:0:\"\";s:9:\"animation\";s:0:\"\";s:15:\"animation_delay\";s:3:\"0.0\";s:2:\"id\";s:0:\"\";s:5:\"class\";s:0:\"\";s:10:\"margin_top\";s:0:\"\";s:17:\"margin_top_medium\";s:0:\"\";s:21:\"margin_top_responsive\";s:0:\"\";s:12:\"margin_right\";s:0:\"\";s:19:\"margin_right_medium\";s:0:\"\";s:23:\"margin_right_responsive\";s:0:\"\";s:13:\"margin_bottom\";s:0:\"\";s:20:\"margin_bottom_medium\";s:0:\"\";s:24:\"margin_bottom_responsive\";s:0:\"\";s:11:\"margin_left\";s:0:\"\";s:18:\"margin_left_medium\";s:0:\"\";s:22:\"margin_left_responsive\";s:0:\"\";s:17:\"row_width_default\";s:4:\"full\";s:25:\"row_content_width_default\";s:4:\"full\";s:4:\"type\";s:9:\"rich-text\";s:24:\"flrich1597686484408_text\";s:0:\"\";s:24:\"flrich1597686838345_text\";s:0:\"\";}}s:13:\"5f3ac2fed22f7\";O:8:\"stdClass\":5:{s:4:\"node\";s:13:\"5f3ac2fed22f7\";s:4:\"type\";s:12:\"column-group\";s:6:\"parent\";s:13:\"5f3ac0c776c0d\";s:8:\"position\";i:2;s:8:\"settings\";s:0:\"\";}s:13:\"5f3ac2fed2392\";O:8:\"stdClass\":5:{s:4:\"node\";s:13:\"5f3ac2fed2392\";s:4:\"type\";s:6:\"column\";s:6:\"parent\";s:13:\"5f3ac2fed22f7\";s:8:\"position\";i:0;s:8:\"settings\";O:8:\"stdClass\":1:{s:4:\"size\";i:100;}}s:13:\"5f3ac304d492b\";O:8:\"stdClass\":5:{s:4:\"node\";s:13:\"5f3ac304d492b\";s:4:\"type\";s:6:\"module\";s:6:\"parent\";s:13:\"5f3ac2fed2392\";s:8:\"position\";i:0;s:8:\"settings\";O:8:\"stdClass\":25:{s:4:\"text\";s:1235:\"Few topics have received broader attention within contemporary philosophy than that of responsibility. Current interest in such questions of responsibility draw on a broad range of approaches and methods, from those customarily associated with analytic philosophy to those associated with phenomenology and existentialism, deconstruction, critical theory, feminist theory, race theory, and post-colonial theory. Yet, despite the expanse of current interest, philosophers have not fully appreciated the contributions that can be made to questions of responsibility by contemporary hermeneutics. The purpose of my presentation will be to examine one contour of responsibility at issue in the hermeneutical experience of understanding. In this, I shall argue that the responsibility to understand is not foremost a responsibility to reach agreement or achieve correct knowledge of something. Rather, the responsibility to understand is a responsibility to cultivate and enact what I refer to as a capacity for displacement, that is, a capacity to put one’s prejudices—and thus oneself—into question, to remain open to the new in the face of such self-interrogation, and to come to understand things and oneself otherwise through it.\";s:18:\"responsive_display\";s:0:\"\";s:18:\"visibility_display\";s:0:\"\";s:26:\"visibility_user_capability\";s:0:\"\";s:9:\"animation\";s:0:\"\";s:15:\"animation_delay\";s:3:\"0.0\";s:2:\"id\";s:0:\"\";s:5:\"class\";s:0:\"\";s:10:\"margin_top\";s:0:\"\";s:17:\"margin_top_medium\";s:0:\"\";s:21:\"margin_top_responsive\";s:0:\"\";s:12:\"margin_right\";s:0:\"\";s:19:\"margin_right_medium\";s:0:\"\";s:23:\"margin_right_responsive\";s:0:\"\";s:13:\"margin_bottom\";s:0:\"\";s:20:\"margin_bottom_medium\";s:0:\"\";s:24:\"margin_bottom_responsive\";s:0:\"\";s:11:\"margin_left\";s:0:\"\";s:18:\"margin_left_medium\";s:0:\"\";s:22:\"margin_left_responsive\";s:0:\"\";s:17:\"row_width_default\";s:4:\"full\";s:25:\"row_content_width_default\";s:4:\"full\";s:4:\"type\";s:9:\"rich-text\";s:24:\"flrich1597686532253_text\";s:0:\"\";s:24:\"flrich1597687764714_text\";s:0:\"\";}}s:13:\"5f3ac3f6674de\";O:8:\"stdClass\":5:{s:4:\"node\";s:13:\"5f3ac3f6674de\";s:4:\"type\";s:12:\"column-group\";s:6:\"parent\";s:13:\"5f3ac0c776c0d\";s:8:\"position\";i:3;s:8:\"settings\";s:0:\"\";}s:13:\"5f3ac3f667569\";O:8:\"stdClass\":5:{s:4:\"node\";s:13:\"5f3ac3f667569\";s:4:\"type\";s:6:\"column\";s:6:\"parent\";s:13:\"5f3ac3f6674de\";s:8:\"position\";i:0;s:8:\"settings\";O:8:\"stdClass\":1:{s:4:\"size\";i:100;}}s:13:\"5f3ac40fd48ff\";O:8:\"stdClass\":5:{s:4:\"node\";s:13:\"5f3ac40fd48ff\";s:4:\"type\";s:6:\"module\";s:6:\"parent\";s:13:\"5f3ac3f667569\";s:8:\"position\";i:0;s:8:\"settings\";O:8:\"stdClass\":25:{s:4:\"text\";s:114:\"<h3 style=\"text-align: center;\"><strong>Thursday, September 19, 2019 • 3:45 PM • YMCA 401</strong></h3>\n&nbsp;\";s:18:\"responsive_display\";s:0:\"\";s:18:\"visibility_display\";s:0:\"\";s:26:\"visibility_user_capability\";s:0:\"\";s:9:\"animation\";s:0:\"\";s:15:\"animation_delay\";s:3:\"0.0\";s:2:\"id\";s:0:\"\";s:5:\"class\";s:0:\"\";s:10:\"margin_top\";s:0:\"\";s:17:\"margin_top_medium\";s:0:\"\";s:21:\"margin_top_responsive\";s:0:\"\";s:12:\"margin_right\";s:0:\"\";s:19:\"margin_right_medium\";s:0:\"\";s:23:\"margin_right_responsive\";s:0:\"\";s:13:\"margin_bottom\";s:0:\"\";s:20:\"margin_bottom_medium\";s:0:\"\";s:24:\"margin_bottom_responsive\";s:0:\"\";s:11:\"margin_left\";s:0:\"\";s:18:\"margin_left_medium\";s:0:\"\";s:22:\"margin_left_responsive\";s:0:\"\";s:17:\"row_width_default\";s:4:\"full\";s:25:\"row_content_width_default\";s:4:\"full\";s:4:\"type\";s:9:\"rich-text\";s:24:\"flrich1597686799246_text\";s:0:\"\";s:24:\"flrich1597686891975_text\";s:0:\"\";}}}'),
